import * as PIXI from 'pixi.js';
import { debug } from 'console';

// Set up game window & Images // 
const app = new PIXI.Application({ backgroundColor: 0x1099bb, width: 800, height: 608});
const background = PIXI.Sprite.from('Images/Background.png');
const Wyvern_Head = PIXI.Sprite.from('Images/Wyvern_Head.png');
const food = PIXI.Sprite.from("Images/Soul_of_Flight/tile000.png");

document.body.appendChild(app.view);
document.addEventListener('keydown', keyPressed);
background.width = app.screen.width;
background.height = app.screen.height;
app.stage.addChild(background);

let gameOn = false;
let onlyAtStart = false;
let xspeed = 32;
let yspeed = 0;
let seconds = 0;
let score = 0;
let totalBody = 1;
const totalBodies:PIXI.Sprite[] = [];

StartGame();


// Start // 
function StartGame(){
    if (onlyAtStart == false){   
        Wyvern_Head.anchor.set(0.5);
        
        app.stage.addChild(Wyvern_Head);
        food.anchor.set(0.5);
        app.stage.addChild(food);
        totalBodies.push(Wyvern_Head);
        
        SpawnWall();
    }

    Wyvern_Head.x = 192;
    Wyvern_Head.y = 288;
    Wyvern_Head.rotation = 3.12;
    xspeed = 32;
    yspeed = 0;
    SpawnFood();
    AddBody();


    gameOn = true;
    onlyAtStart = true;
}

// Update game // 
app.ticker.add((delta) => {
  seconds += (1 / 60) * delta;
  if(seconds >= 0.2 ){
    if (gameOn == true){
        ActiveGame();
    }
    seconds = 0;
  }
});

// Update function // 
function ActiveGame(){
    // Check snake length // 
    if (totalBody === totalBodies.length){
        for (var i = 0; i < totalBodies.length-1; i++){
            if (i != 0){
            totalBodies[i].x =   totalBodies[i + 1].x;
            totalBodies[i].y =   totalBodies[i + 1].y;
            totalBodies[i].rotation =   totalBodies[i + 1].rotation;
            }
        }
    }
    totalBodies[totalBody - 1].x = Wyvern_Head.x;
    totalBodies[totalBody - 1].y = Wyvern_Head.y;
    totalBodies[totalBody - 1].rotation = Wyvern_Head.rotation;
    
    // Move speed // 
    Wyvern_Head.x += xspeed;
    Wyvern_Head.y += yspeed;

    // If eating // 
    if (Eat()){
        score + 1;
        AddBody();
        SpawnFood();
    }

    // Kinda tells it // 
    Die();
}

// Adds another body to the snake // 
function AddBody(){
    const Wyvern_Tail = PIXI.Texture.from('Images/Wyvern_Tail.png');
    const bodyImage = PIXI.Texture.from('Images/Wyvern_Body.png');
    const Wyvern_Body = new PIXI.Sprite(bodyImage);
    
    // Tail //
    if (totalBody == 1){
        Wyvern_Body.texture = Wyvern_Tail;
    }

    Wyvern_Body.x = -100;
    Wyvern_Body.anchor.set(0.5);
    app.stage.addChild(Wyvern_Body);
    totalBodies.push(Wyvern_Body);
    totalBody++;
}

// Snake turn based on key Inputs  //
function TurnSnake(thisWay:string){
    if (thisWay == "Left"){
        xspeed = -32;
        yspeed = 0;
        Wyvern_Head.rotation = 0;

    }
    if (thisWay == "Down"){
        xspeed = 0;
        yspeed = 32;
        Wyvern_Head.rotation = 4.71;
        
    }
    if (thisWay == "Up"){
        xspeed = 0;
        yspeed = -32;
        Wyvern_Head.rotation = 1.57;
        
    }
    if (thisWay == "Right"){
        xspeed = 32;
        yspeed = 0;
        Wyvern_Head.rotation = 3.12;
        
    }
}

// Key Inputs // 
function keyPressed(event: KeyboardEvent){
    if (gameOn == true){
        if (event.keyCode == 65){
            // left // 
            TurnSnake("Left")
        }
        if (event.keyCode == 83){
            // down // 
            TurnSnake("Down")
        }
        if (event.keyCode == 87){
            // up // 
            TurnSnake("Up")
        }
        if (event.keyCode == 68){
            // right // 
            TurnSnake("Right")
        }
    }

    // Restart // 
    if (event.keyCode == 82){
        Restart();
    }
}

// Replace food when eaten // 
function SpawnFood(){
    food.x = getRandomNumber(24) * 32;
    food.y = getRandomNumber(19) * 32;
    if (food.x == 0 || food.y == 0){
        SpawnFood();
    }
    for (var i = totalBodies.length; i < 0; i++){
        if (food.x == totalBodies[i].x && food.y == totalBodies[i].y){
            SpawnFood();
        }
    }
}

// When Head and Food are on the same place //
function Eat(){
    if(Wyvern_Head.x == food.x && Wyvern_Head.y == food.y){
        return true;
    }
}

// Get random number // 
function getRandomNumber(max:number) {
    return Math.floor(Math.random() * Math.floor(max));
}

// Spawn outside walls of the game for look // 
function SpawnWall(){
    for (var i = 0; i < 50; i++){
        const Wallblock = PIXI.Sprite.from('Images/Stone_Block.png');
        Wallblock.anchor.set(0.5);
        Wallblock.x = 16 * i + 8;
        Wallblock.y = 8;
        app.stage.addChild(Wallblock);
    }

    for (var i = 0; i < 50; i++){
        const Wallblock = PIXI.Sprite.from('Images/Stone_Block.png');
        Wallblock.anchor.set(0.5);
        Wallblock.x = 16 * i + 8;
        Wallblock.y = 16 * 37 + 8;
        app.stage.addChild(Wallblock);
    }

    for (var i = 0; i < 40; i++){
        const Wallblock = PIXI.Sprite.from('Images/Stone_Block.png');
        Wallblock.anchor.set(0.5);
        Wallblock.x = 8;
        Wallblock.y = 16 * i + 8;
        app.stage.addChild(Wallblock);
    }

    for (var i = 0; i < 40; i++){
        const Wallblock = PIXI.Sprite.from('Images/Stone_Block.png');
        Wallblock.anchor.set(0.5);
        Wallblock.x = 16 * 49 + 8;
        Wallblock.y = 16 * i + 8;
        app.stage.addChild(Wallblock);
    }
        
}

// Check if snake is in dead position //
function Die(){
    for (var i = 0; i < totalBodies.length - 1; i++){
        if (Wyvern_Head.x == totalBodies[i + 1].x && Wyvern_Head.y == totalBodies[i + 1].y){
            gameOn = false;
        }
    }

    if (Wyvern_Head.x >= 800 || Wyvern_Head.x <= 0){
        gameOn = false;
    }

    if (Wyvern_Head.y >= 608 || Wyvern_Head.y <= 0){
        gameOn = false;
    }
}

// Restarts Game // 
function Restart(){
    /*
    for (var i = totalBodies.length - 1; i < 0; i++){
        //bodyContainer.addChild(totalBodies[i]);
        //app.stage.removeChild(totalBodies[i]);
        //totalBodies.concat(bodyContainer);
        //totalBodies[i].texture.destroy();
        //totalBodies.pop()
        //totalBodies[i].destroy({children:true, texture:true, baseTexture:true});
        //bodyContainer.destroy({children:true, texture:true, baseTexture:true});S
    }

    for( var i = 0; i < app.view.children.length - 1; i++) {
        app.view.children[i].remove();
    }
    */
    score = 0;
    totalBody = 1;
    StartGame();
}
